    @Test
    public void test01() {
        for(int i=0; i<100; ++i) {
            Collections.shuffle(PKG_LIST);
            List<String> req = PKG_LIST.subList(0, 200 + i * 2);
            List<String> hashed = applyHash(req);
            appUpdateSupportService.searchSubContentByPkg("ANY-PHONE-4APP", hashed, true);
        }
    }

    private List<String> applyHash(List<String> pkgList) {
        StopWatch sw = new StopWatch();
        sw.start();
        List<String> res = new ArrayList<String>(pkgList.size());

        for (String nm : pkgList) {
            res.add(DisplayCryptUtils.hashPkgNm(nm));
        }

        sw.stop();
        logger.info("Hash Complete - elapTime: {}ms / size: {}", sw.getTime(), res.size());

        return res;
    }

